import "./App.css";
import Header from "./Header/Header";
import Footer from "./footer";
import Home from "./Home";
import Card from "./Header/Card";
import Welcome from "./sections/Welcome";

import Cardpage from "./Header/Cardpage";
import Must from "./Header/Must";
import Fullstory from "./sections/Fullstrory";

import Around from "./Header/Around";
import Page from "./Header/Page";
import Longereads from "./Header/Longreads";



function App() {
  return (
    <div className="App">
    <Home />
  <Header /><br />
<Page />
    
     <Card />
     <section>
     <Cardpage />
     </section>

     <br />
     

   
      <Welcome />
      <br />

     
      <Fullstory />

      <br />
      <Longereads />
      
      <Around />

      <Must /><br />

      
      <Footer/>
    </div>
  );
}

export default App;
